import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './HomePage';
import Questionnaire from './Questionnaire';
import {NavLink} from "react-bootstrap";
import Voice from "./voice";

const TopBar = () => {
  return (
    <Navbar collapseOnSelect expand="lg" className={"topBar"}>
      <Container>
        <Navbar.Brand as={NavLink} to="/" id="title" href = '/'>SpeakTrainer</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
           <Nav variant="tabs" defaultActiveKey="/">
            <Nav.Item>
              <Nav.Link as={NavLink} to="/" href = '/' id = "menu">Home</Nav.Link>
            </Nav.Item>
              <Nav.Item>
              <Nav.Link as={NavLink} to="voice" href='/voice/' eventKey="link-1" id = "menu">Voice</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link as={NavLink} to="text" eventKey="link-2" id = "menu">Text</Nav.Link>
            </Nav.Item>
           </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>

  );
}

function App() {
  return (
    <Router>
      <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/questionnaire/" element={<Questionnaire />} />
          <Route path="/voice/" element={<Voice />} />
      </Routes>
    </Router>
  );
}
export default App;
export {TopBar};
